    render(){
        return (
            <React.Fragment>
                <div className="py-5">
                  <div className="container">
                      <Title name="Welcome to" title="My Store"/>
                      <div className="row">

                      </div>

                  </div>
                </div>
            </React.Fragment>
        );
    }
}
